import React, { useEffect  } from 'react';



export const DisplayDog = ({getDogFromUrl, dogs, count}) => {

    useEffect(() => {
        getDogFromUrl();
    },[]);

    return(
        <div className="dog-image">
            <h3>Random Dog</h3>
            <p>
                File size = {dogs[count].fileSizeBytes}
            </p>
            <img src={dogs[count].url} alt="Random Dog" width="200"/>
        </div>
    );
}

export default DisplayDog
